28'),(19,'remote_upload_enabled','false','2025-12-27 18:38:49','2025-12-27 18:38:49'),(20,'custom_domain_enabled','false','2025-12-27 18:38:52','2025-12-27 18:38:52'),(21,'copyright_text','Cloud Host','2025-12-27 18:45:58','2025-12-27 20:29:40'),(22,'copyright_year','2022-2025','2025-12-27 18:45:58','2025-12-27 20:29:40'),(23,'page_about_content','<h1>Tentang Kami</h1>\r\n<p>\r\n    <strong>cloud host</strong> adalah platform <strong>Digital Asset Distribution</strong> modern yang dirancang untuk membantu para pengembang konten mengelola, menyimpan, dan mendistribusikan karya digital mereka dengan sistem bagi hasil yang efisien melalui parameter tayangan konten.\r\n</p>\r\n\r\n<h1>Layanan Kami</h1>\r\n<p>\r\n    Prioritas kami adalah menyediakan infrastruktur hosting video yang stabil untuk distribusi konten global. Kami memastikan setiap interaksi pada konten yang diunggah tercatat secara sistematis untuk keperluan analisis data dan akuntansi distribusi bagi pemilik konten.\r\n</p>\r\n\r\n<h1>Transparansi & Keamanan</h1>\r\n<p>\r\n    Kami sangat menjunjung tinggi kejujuran dalam ekosistem kami. Sistem kami dilengkapi dengan teknologi deteksi penipuan canggih untuk memastikan bahwa semua interaksi adalah nyata dari manusia, bukan bot. Kami berkomitmen untuk memberikan laporan statistik yang akurat dan pembayaran tepat waktu kepada pengguna kami.\r\n</p>\r\n\r\n<h1>Kenapa Memilih Kami?</h1>\r\n<ul>\r\n    <li>\r\n        <strong>Optimasi Distribusi:</strong> Infrastruktur cloud yang dirancang untuk pengiriman data yang cepat.\r\n    </li>\r\n    <li>\r\n        <strong>Transparansi Data:</strong> Sistem pelaporan performa konten yang mendetail dan akurat.\r\n    </li>\r\n    <li>\r\n        <strong>Manajemen Mandiri:</strong> Kendali penuh atas hak akses, pengarsipan, dan organisasi folder video Anda.\r\n    </li>\r\n</ul>','2025-12-27 18:45:58','2025-12-27 20:36:13'),(24,'page_contact_content','<!DOCTYPE html>\r\n<html lang=\"id\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <title>Contact Us - cloud host</title>\r\n    <link rel=\"stylesheet\" href=\"assets/style.css\">\r\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css\">\r\n    <style>\r\n        .legal-container {\r\n            max-width: 600px;\r\n            margin: 50px auto;\r\n            padding: 40px;\r\n            background: var(--bg-card);\r\n            border: 1px solid var(--border-color);\r\n            border-radius: 12px;\r\n            line-height: 1.6;\r\n            color: #ccc;\r\n        }\r\n        h1 { color: #00ffff; text-align: center; }\r\n        .back-link { display: inline-block; margin-bottom: 20px; color: var(--primary); text-decoration: none; font-size: 14px; }\r\n        .contact-info { margin-top: 30px; text-align: center; }\r\n        .contact-item { margin-bottom: 20px; font-size: 16px; }\r\n        .contact-item i { color: #00ffff; margin-right: 10px; width: 25px; }\r\n        .contact-form { margin-top: 30px; border-top: 1px solid #333; pt-30px; padding-top: 30px; }\r\n    </style>\r\n</head>\r\n<body>\r\n    <div class=\"legal-container\">\r\n        <a href=\"index\" class=\"back-link\"><i class=\"fa-solid fa-arrow-left\"></i> Kembali</a>\r\n        <h1>Hubungi Kami</h1>\r\n        \r\n        <p style=\"text-align: center; color: #777;\">Punya pertanyaan atau butuh bantuan? Tim kami siap membantu Anda.</p>\r\n        \r\n        <div class=\"contact-info\">\r\n            <div class=\"contact-item\" style=\"background: rgba(37, 211, 102, 0.1); padding: 15px; border-radius: 8px; border: 1px solid #25d366; margin-bottom: 15px;\">\r\n                <div style=\"font-size: 14px; color: #25d366; font-weight: bold; margin-bottom: 5px;\">Admin</div>\r\n                <div style=\"display: flex; align-items: center; justify-content: center; gap: 10px;\">\r\n                    <i class=\"fa-brands fa-whatsapp\" style=\"color: #25d366;\"></i>\r\n                    <span style=\"font-weight: bold; color: white;\">08999899922</span>\r\n                </div>\r\n                <a href=\"https://wa.me/628999899922\" target=\"_blank\" class=\"btn\" style=\"background: #25d366; color: black; padding: 5px 15px; font-size: 12px; margin-top: 10px; display: inline-block; border-radius: 20px; text-decoration: none; font-weight: bold;\">\r\n                    Chat Now\r\n                </a>\r\n            </div>\r\n\r\n            <div class=\"contact-item\" style=\"background: rgba(37, 211, 102, 0.1); padding: 15px; border-radius: 8px; border: 1px solid #25d366; margin-bottom: 20px;\">\r\n                <div style=\"font-size: 14px; color: #25d366; font-weight: bold; margin-bottom: 5px;\">Staff Admin</div>\r\n                <div style=\"display: flex; align-items: center; justify-content: center; gap: 10px;\">\r\n                    <i class=\"fa-brands fa-whatsapp\" style=\"color: #25d366;\"></i>\r\n                    <span style=\"font-weight: bold; color: white;\">08388853885</span>\r\n                </div>\r\n                <a href=\"https://wa.me/628388853885\" target=\"_blank\" class=\"btn\" style=\"background: #25d366; color: black; padding: 5px 15px; font-size: 12px; margin-top: 10px; display: inline-block; border-radius: 20px; text-decoration: none; font-weight: bold;\">\r\n                    Chat Now\r\n                </a>\r\n            </div>\r\n            <div class=\"contact-item\">\r\n                <i class=\"fa-solid fa-clock\"></i>\r\n                <span>Senin - Sabtu: 09:00 - 18:00 WIB</span>\r\n            </div>\r\n            <div class=\"contact-item\">\r\n                <i class=\"fa-solid fa-location-dot\"></i>\r\n                <span>Surabaya, Jawa Timur</span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"contact-form\">\r\n            <p style=\"font-size: 13px; color: #555; text-align: center;\">Format pengaduan atau kerja sama dapat dikirimkan melalui nomor WhatsApp di atas.</p>\r\n        </div>\r\n\r\n        <div style=\"margin-top: 30px; padding: 15px; background: rgba(0, 255, 255, 0.05); border-radius: 8px; border-left: 4px solid #00ffff;\">\r\n            <p style=\"font-size: 12px; color: #aaa; margin: 0;\">\r\n                <strong>Catatan Keamanan:</strong> Kami tidak pernah meminta password akun Anda. Jangan pernah memberikan informasi rahasia kepada pihak manapun yang mengaku atas nama cloud host.\r\n            </p>\r\n        </div>\r\n    </div>\r\n<script defer src=\"https://static.cloudflareinsights.com/beacon.min.js/vcd15cbe7772f49c399c6a5babf22c1241717689176015\" integrity=\"sha512-ZpsOmlRQV6y907TI0dKBHq9Md29nnaEIPlkf84rnaERnq6zvWvPUqr2ft8M1aS28oN72PdrCzSjY4U6VaAw1EQ==\" data-cf-beacon=\'{\"rayId\":\"9b4b94f68b57ced3\",\"version\":\"2025.9.1\",\"r\":1,\"token\":\"d208e43ae0c7493d8fea57735b0f70e1\",\"serverTiming\":{\"name\":{\"cfExtPri\":true,\"cfEdge\":true,\"cfOrigin\":true,\"cfL4\":true,\"cfSpeedBrain\":true,\"cfCacheStatus\":true}}}\' crossorigin=\"anonymous\"></script>\r\n</body>\r\n</html>','2025-12-27 18:45:58','2025-12-27 20:32:02'),(25,'page_privacy_content','<!DOCTYPE html>\r\n<html lang=\"id\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <title>Privacy Policy - cloud host</title>\r\n    <link rel=\"stylesheet\" href=\"assets/style.css\">\r\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css\">\r\n    <style>\r\n        .legal-container {\r\n            max-width: 800px;\r\n            margin: 50px auto;\r\n            padding: 30px;\r\n            background: var(--bg-card);\r\n            border: 1px solid var(--border-color);\r\n            border-radius: 12px;\r\n            line-height: 1.6;\r\n            color: #ccc;\r\n        }\r\n        h1, h2, h3 { color: #00ffff; }\r\n        .back-link { display: inline-block; margin-bottom: 20px; color: var(--primary); text-decoration: none; font-size: 14px; }\r\n    </style>\r\n</head>\r\n<body>\r\n    <div class=\"legal-container\">\r\n        <a href=\"index\" class=\"back-link\"><i class=\"fa-solid fa-arrow-left\"></i> Kembali</a>\r\n        <h1>Kebijakan Privasi</h1>\r\n        <p>Terakhir diperbarui: 28 December 2025</p>\r\n        \r\n        <h2>1. Informasi yang Kami Kumpulkan</h2>\r\n        <p>Kami mengumpulkan informasi yang Anda berikan langsung kepada kami saat mendaftar akun, seperti alamat email, nama pengguna, dan jawaban keamanan.</p>\r\n        \r\n        <h2>2. Penggunaan Informasi</h2>\r\n        <p>Informasi Anda digunakan untuk mengelola akun Anda, memproses transaksi saldo, dan memastikan keamanan layanan kami melalui fitur captcha dan deteksi IP.</p>\r\n        \r\n        <h2>3. Perlindungan Data</h2>\r\n        <p>Kami menggunakan standar keamanan industri termasuk enkripsi password bcrypt dan perlindungan CSRF untuk melindungi data pribadi Anda.</p>\r\n        \r\n        <h2>4. Cookie</h2>\r\n        <p>Kami menggunakan cookie fungsional untuk mengidentifikasi sesi login Anda dan meningkatkan pengalaman pengguna.</p>\r\n        \r\n        <h2>5. Kontak Kami</h2>\r\n        <p>Jika Anda memiliki pertanyaan tentang kebijakan ini, silakan hubungi administrator melalui fitur chat yang tersedia di dashboard.</p>\r\n    </div>\r\n<script defer src=\"https://static.cloudflareinsights.com/beacon.min.js/vcd15cbe7772f49c399c6a5babf22c1241717689176015\" integrity=\"sha512-ZpsOmlRQV6y907TI0dKBHq9Md29nnaEIPlkf84rnaERnq6zvWvPUqr2ft8M1aS28oN72PdrCzSjY4U6VaAw1EQ==\" data-cf-beacon=\'{\"rayId\":\"9b4b954c79a8ced3\",\"version\":\"2025.9.1\",\"r\":1,\"token\":\"d208e43ae0c7493d8fea57735b0f70e1\",\"serverTiming\":{\"name\":{\"cfExtPri\":true,\"cfEdge\":true,\"cfOrigin\":true,\"cfL4\":true,\"cfSpeedBrain\":true,\"cfCacheStatus\":true}}}\' crossorigin=\"anonymous\"></script>\r\n</body>\r\n</html>','2025-12-27 18:45:58','2025-12-27 20:32:02'),(26,'page_terms_content','<!DOCTYPE html>\r\n<html lang=\"id\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <title>Terms of Service - cloud host</title>\r\n    <link rel=\"stylesheet\" href=\"assets/style.css\">\r\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css\">\r\n    <style>\r\n        .legal-container {\r\n            max-width: 800px;\r\n            margin: 50px auto;\r\n            padding: 30px;\r\n            background: var(--bg-card);\r\n            border: 1px solid var(--border-color);\r\n            border-radius: 12px;\r\n            line-height: 1.6;\r\n            color: #ccc;\r\n        }\r\n        h1, h2, h3 { color: #00ffff; }\r\n        .back-link { display: inline-block; margin-bottom: 20px; color: var(--primary); text-decoration: none; font-size: 14px; }\r\n    </style>\r\n</head>\r\n<body>\r\n    <div class=\"legal-container\">\r\n        <a href=\"index\" class=\"back-link\"><i class=\"fa-solid fa-arrow-left\"></i> Kembali</a>\r\n        <h1>Syarat dan Ketentuan</h1>\r\n        <p>Terakhir diperbarui: 28 December 2025</p>\r\n        \r\n        <h2>1. Penerimaan Ketentuan</h2>\r\n        <p>Dengan mengakses atau menggunakan cloud host, Anda setuju untuk terikat oleh Syarat dan Ketentuan ini.</p>\r\n        \r\n        <h2>2. Akun Pengguna</h2>\r\n        <p>Anda bertanggung jawab untuk menjaga kerahasiaan akun dan password Anda. Penggunaan bot atau script otomatis untuk memanipulasi saldo dilarang keras dan akan mengakibatkan pemblokiran akun permanen.</p>\r\n        \r\n        <h2>3. Monetisasi</h2>\r\n        <p>Sistem pendapatan didasarkan pada interaksi video yang valid. Kami berhak meninjau setiap transaksi saldo sebelum penarikan (withdraw) disetujui.</p>\r\n        \r\n        <h2>4. Batasan Tanggung Jawab</h2>\r\n        <p>cloud host tidak bertanggung jawab atas kerugian finansial atau teknis yang timbul dari penyalahgunaan layanan oleh pihak ketiga.</p>\r\n        \r\n        <h2>5. Perubahan Layanan</h2>\r\n        <p>Kami berhak mengubah atau menghentikan fitur layanan kapan saja tanpa pemberitahuan sebelumnya.</p>\r\n    </div>\r\n<script defer src=\"https://static.cloudflareinsights.com/beacon.min.js/vcd15cbe7772f49c399c6a5babf22c1241717689176015\" integrity=\"sha512-ZpsOmlRQV6y907TI0dKBHq9Md29nnaEIPlkf84rnaERnq6zvWvPUqr2ft8M1aS28oN72PdrCzSjY4U6VaAw1EQ==\" data-cf-beacon=\'{\"rayId\":\"9b4b95a4bf19ced3\",\"version\":\"2025.9.1\",\"r\":1,\"token\":\"d208e43ae0c7493d8fea57735b0f70e1\",\"serverTiming\":{\"name\":{\"cfExtPri\":true,\"cfEdge\":true,\"cfOrigin\":true,\"cfL4\":true,\"cfSpeedBrain\":true,\"cfCacheStatus\":true}}}\' crossorigin=\"anonymous\"></script>\r\n</body>\r\n</html>','2025-12-27 18:45:58','2025-12-27 20:32:02'),(27,'device_fingerprint','b8d646f7a10d94ddf5aa365d8e268dc77193c012bd6c5c6c399ffdeb17876d93','2025-12-27 18:45:58','2025-12-29 21:43:41'),(28,'cpm_flat_enabled','true','2025-12-27 18:57:56','2025-12-29 23:00:00'),(29,'min_withdrawal','250000','2025-12-27 19:41:07','2025-12-27 19:44:44'),(30,'admin_security_code','ameena','2025-12-27 20:29:10','2025-12-27 20:29:10'),(31,'primary_color','#3b82f6','2025-12-29 12:26:25','2025-12-29 12:26:25'),(32,'secondary_color','#00ffff','2025-12-29 12:26:25','2025-12-29 12:26:50'),(33,'custom_css',NULL,'2025-12-29 12:26:25','2025-12-29 12:26:25'),(34,'max_upload_size','300','2025-12-29 21:43:41','2025-12-29 21:50:38'),(35,'mysqldump_command','C:\\laragon\\bin\\mysql\\mysql-8.4.3-winx64\\bin\\mysqldump','2025-12-30 01:34:27','2025-12-30 01:47:43'),(36,'active_theme','neon-cyan','2025-12-30 03:24:48','2025-12-30 04:47:49'),(37,'theme_var_--bg-dark','#000808','2025-12-30 03:24:48','2025-12-30 04:47:49'),(38,'theme_var_--bg-card','#001212','2025-12-30 03:24:48','2025-12-30 04:47:49'),(39,'theme_var_--bg-hover','#001a1a','2025-12-30 